import React, { useEffect, useState } from "react";
import { getUser } from "../actions/service";

const Lista = (props) => {
  const [user, setUser] = useState({});

  useEffect(() => {
    let query = getUser();
    console.log(query.data);
    setUser(query.data);
  }, []);

  return (
    <div>
      <h1>Lista</h1>
    </div>
  );
};

export default Lista;
